import "../css/Game.css";
import Help from "./Help";
import Tetris from "./Tetris";
import TetrisHeader from "./TetrisHeader";
import { useState } from "react";


const Game = () => {
    const [isStart, setIsStart] = useState(false);
    const onClickSingle = () => {
        setIsStart(true);
    }

    return(
        <div className="Game">
            <TetrisHeader />
            {isStart ? <Tetris /> : 
            (<div id="tetris">
                <h1>TETRIS</h1>
                <Help />

                <div className="tetris-contents">
                    <div className="button-container">
                        <div className="button-arrow">
                            <div>1</div>
                            <div>1</div>
                            <div>1</div>
                        </div>
                        <div className="button-list">
                            <button onClick={onClickSingle}>Single Play</button>
                            <button>Multi Play</button>
                            <button>Setting</button>
                        </div>
                    </div>
                </div>
            </div>)}
        </div>
    )
}
export default Game;
